import React, { Component } from 'react';
import PropTypes from 'prop-types';
import './CssPages/Login.css';
import { Link } from 'react-router-dom';
import Header from '../Components/Header';

export default class Login extends Component {
  render() {
    const { handleUserLog,
      handleFillForm,
      name,
      isDisabled,
    } = this.props;
    return (
      <div data-testid="page-login" className="login">
        <Header />
        <form className="form">

          <label htmlFor="name">
            <input
              name="name"
              data-testid="login-name-input"
              type="text"
              className="name-login"
              onChange={ handleFillForm }
            />
            nome
          </label>

          <label htmlFor="email">
            <input
              name="email"
              data-testid="login-email-input"
              type="email"
              className="email-login"
              onChange={ handleFillForm }
            />
            email
          </label>

          <label htmlFor="image">
            <input name="image" type="file" />
            <img
              alt={ `Foto do perfil de ${name}` }
              data-testid="login-image-input"
              className="image-login"
              onChange={ handleFillForm }
            />
            Imagem
          </label>

          <label htmlFor="description">
            <textarea
              name="description"
              data-testid="login-description-input"
              className="description-login"
              onChange={ handleFillForm }
            />
            descrição
          </label>

          <Link to="/loading">
            <button
              data-testid="login-submit-button"
              disabled={ isDisabled }
              className="button-login"
              type="button"
              onClick={ handleUserLog }
            >
              Entrar
            </button>
          </Link>
        </form>

      </div>
    );
  }
}

Login.propTypes = {
  handleLoginSubmit: PropTypes.func.isRequired,
  handleFillForm: PropTypes.func.isRequired,
  name: PropTypes.string.isRequired,
  isDisabled: PropTypes.bool.isRequired,
};
